package array;

public class array2dimensions {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
   
		int [][] prices = new int[4][4];
		
		prices[0][1]=(10);
		prices[0][2]=(20);
		prices[0][3]=(30);
		
		
		prices[1][1]=(10);
		prices[1][2]=(20);
		prices[1][3]=(30);
		
		
		prices[2][1]=(10);
		prices[2][2]=(20);
		prices[2][3]=(30);
		
		
		prices[3][1]=(10);
		prices[3][2]=(20);
		prices[3][3]=(30);
		
		
		
		System.out.println(prices[0][1]);
		System.out.println(prices[0][2]);
		System.out.println(prices[0][3]);
		
	
		System.out.println(prices[1][1]);
		System.out.println(prices[1][2]);
		System.out.println(prices[1][3]);
		
		
		System.out.println(prices[2][1]);
		System.out.println(prices[2][2]);
		System.out.println(prices[2][3]);
		
		
		System.out.println(prices[3][1]);
		System.out.println(prices[3][2]);
		System.out.println(prices[3][3]);
		
	   
	}

}
